const getRoastOptions = () => {
    const roasts = {
        category: "roast",
        subCategories: [
            {category: "Light", url: "/product-category/roast/light/"},
            {category: "Medium", url: "/product-category/roast/medium/"},
            {category: "Dark", url: "/product-category/roast/dark/"},
            {category: "Decaf", url: "/product-category/roast/decaf/"},
        ]
    }

    return roasts;
}

export {
    getRoastOptions
}
